// index.js or another high-level component
import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { InternshipProvider } from './hooks/InternshipContext';

ReactDOM.render(
  <React.StrictMode>
    <InternshipProvider>
      <App />
    </InternshipProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
